/*
 *  (non-Javadoc)
 * @see PerfTask#setup()
 */
public void setup() throws Exception {
  super.setup();
  DocMaker docMaker = getRunData().getDocMaker();
  if (docSize > 0) {
    doc = docMaker.makeDocument(docSize);
  } else {
    doc = docMaker.makeDocument();
  }
}

